mapper.select:

select 

from CARDTYPEEXT
where CARDTYPE = #{cardtype,jdbcType=DECIMAL}
  and CREDITPROD = #{creditprod,jdbcType=CHAR}
  and EMBOSSINGTYPE = #{embossingtype,jdbcType=CHAR}

mapper.delete:

delete from CARDTYPEEXT
where CARDTYPE = #{cardtype,jdbcType=DECIMAL}
  and CREDITPROD = #{creditprod,jdbcType=CHAR}
  and EMBOSSINGTYPE = #{embossingtype,jdbcType=CHAR}
